import React, { useState, useRef, useEffect } from 'react';


import dansooImage from './assets/images/dansoo.png';
import akImage from './assets/images/ak.png';
import sound1 from './assets/sounds/Ï§ë.m4a';
import sound2 from './assets/sounds/ÏûÑ.m4a';
import sound3 from './assets/sounds/Î¨¥.m4a';
import sound4 from './assets/sounds/Ìô©.m4a';
import sound5 from './assets/sounds/ÌÉú.m4a';

const App = () => {
  const [answer, setAnswer] = useState('');
  const [message, setMessage] = useState('');
  const [hintVisible, setHintVisible] = useState(false);
  const [hintMessage, setHintMessage] = useState([]);
  const [clickCount, setClickCount] = useState(0);
  const audioRef = useRef(null);
  const [flyingObjectStyle, setFlyingObjectStyle] = useState({});

  useEffect(() => {
    const moveObject = () => {
      const randomX = Math.random() * (window.innerWidth - 100);
      const randomY = Math.random() * (window.innerHeight - 100);
      setFlyingObjectStyle({
        position: 'absolute',
        top: `${randomY}px`,
        left: `${randomX}px`,
        transition: 'top 1s linear, left 1s linear'
      });

      setTimeout(moveObject, 3000);
    };

    moveObject();
  }, []);

  const handleInputChange = (e) => {
    setAnswer(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (answer === 'ÏïÑÎ¶¨Îûë') {
      setMessage('Ï†ïÎãµÏûÖÎãàÎã§!');
    } else {
      setMessage('ÌãÄÎ†∏ÏäµÎãàÎã§. Îã§Ïãú ÏãúÎèÑÌï¥ Î≥¥ÏÑ∏Ïöî.');
    }
    setAnswer('');
  };

  const playSound = (soundFile) => {
    if (audioRef.current) {
      audioRef.current.pause();
      audioRef.current.currentTime = 0;
    }

    audioRef.current = new Audio(soundFile);
    audioRef.current.play();
  };

  const handleCatchHint = () => {
    setClickCount(prevCount => prevCount + 1);
    if (clickCount === 0) {
      setHintMessage(['ÏßÅÏ†ë Ïó∞Ï£ºÌï¥Î≥¥Ïûê!', '1=Ï§ë 2=ÏûÑ 3=Î¨¥ 4=Ìô© 5=ÌÉú']);
    } else if (clickCount === 1) {
      setHintMessage(['Ï†ïÏÑ† ooo, Î∞ÄÏñë ooo']);
    }
    setHintVisible(true);
  };

  const closeHint = () => {
    setHintVisible(false);
  };

  return (
    <div className="app-container">
      <h1>ÎÖ∏Îûò Ï†úÎ™©ÏùÑ ÎßûÏ∂∞Îùº!</h1>
      <h2>Îã®ÏÜå ÏïÖÎ≥¥Î•º Î≥¥Í≥† Ï†ïÎãµÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî!</h2>

      <div className="image-container">
        <div style={{ position: 'relative', display: 'inline-block' }}>
          <img src={dansooImage} alt="Îã®ÏÜå" className="image" />
          <div className="button-container">
            <button onClick={() => playSound(sound1)}>1</button>
            <button onClick={() => playSound(sound2)}>2</button>
            <button onClick={() => playSound(sound3)}>3</button>
            <button onClick={() => playSound(sound4)}>4</button>
            <button onClick={() => playSound(sound5)}>5</button>
          </div>
        </div>
        <img src={akImage} alt="Îã®ÏÜå ÏïÖÎ≥¥" className="image" />
      </div>

      <div className="flying-object" style={flyingObjectStyle} onClick={handleCatchHint}>
        <span role="img" aria-label="ÎèãÎ≥¥Í∏∞" style={{ fontSize: '80px' }}>
          üîç
        </span>
      </div>

      {hintVisible && (
        <div className="hint-popup">
          {hintMessage.map((text, index) => (
            <p key={index}>{text}</p>
          ))}
          <button onClick={closeHint}>Îã´Í∏∞</button>
        </div>
      )}

      <form onSubmit={handleSubmit}>
        <input
          type="text"
          value={answer}
          onChange={handleInputChange}
          placeholder="Ï†ïÎãµÏùÑ ÏûÖÎ†•ÌïòÏÑ∏Ïöî"
          required
        />
        <button type="submit">ÌôïÏù∏</button>
      </form>

      {message && <h3>{message}</h3>}

      <div className="bubble-container">
        <img src={akImage} alt="ÏÑ∏Ï¢ÖÎåÄÏôï" style={{ width: '100px', height: 'auto' }} />
        <div className="bubble">
          <p>ÌíçÏïÖÏùÑ Ïö∏Î†§Îùº</p>
        </div>
      </div>
    </div>
  );
};

export default App;
